   284→    msgCd: data.msg_cd,
   285→    msg1: data.msg1,
   286→    output1: data.output1.map(mapDailyOrderItem),
   287→    output2: mapDailyOrderSummary(data.output2),
   288→    trCont: data.tr_cont,
