   294→export function createKisOrderClient(env: BrokerEnv): KisOrderClient {
   295→  const baseUrl = BASE_URLS[env];
   296→  if (!baseUrl) {
   297→    throw new Error(`Invalid BrokerEnv: "${env}". Expected "prod" or "dev".`);
   298→  }
   299→
   300→  return {
   301→    async buyOrder(
   302→      credentials: KisCredentials,
   303→      token: string,
   304→      params: KisOrderParams,
   305→    ): Promise<KisOrderResponse> {
   306→      return placeOrder(baseUrl, credentials, token, params, BUY_TR_IDS[env]);
   307→    },
   308→
   309→    async sellOrder(
   310→      credentials: KisCredentials,
   311→      token: string,
   312→      params: KisOrderParams,
   313→    ): Promise<KisOrderResponse> {
   314→      return placeOrder(baseUrl, credentials, token, params, SELL_TR_IDS[env]);
   315→    },
   316→
   317→    async getDailyOrders(
   318→      credentials: KisCredentials,
   319→      token: string,
   320→      params: KisDailyOrderParams,
   321→      withinThreeMonths = true,
   322→    ): Promise<KisDailyOrderResponse> {
   323→      const trIds = DAILY_ORDER_TR_IDS[env];
   324→      const trId = withinThreeMonths ? trIds.recent : trIds.old;
