    67→async function execD1(sql: string, remote: boolean): Promise<string> {
    68→  const args = [
    69→    "bunx",
    70→    "wrangler",
    71→    "d1",
    72→    "execute",
    73→    DB_NAME,
    74→    "--command",
    75→    sql,
    76→    "--config",
    77→    WRANGLER_CONFIG,
    78→  ];
    79→  if (remote) args.push("--remote");
    80→
    81→  const proc = Bun.spawn(args, { stdout: "pipe", stderr: "pipe" });
    82→
    83→  const exitCode = await proc.exited;
    84→  const stdout = await new Response(proc.stdout).text();
    85→  const stderr = await new Response(proc.stderr).text();
    86→
    87→  if (exitCode !== 0) {
    88→    console.error(`D1 명령 실패:\n${stderr}`);
    89→    process.exit(1);
    90→  }
    91→
    92→  return stdout;
    93→}
